    true,nt"url": null,nt"notes": "The Schools and Staffing Survey, 2003-04
    (SASS 03-04), is a study that is part of the Schools and Staffing Survey (SASS)
    program. SASS 03-04 (http://nces.ed.gov/surveys/sass) is a survey that covers a
    wide range of topics from teacher demand, teacher and principal characteristics,
    general conditions in schools, principals' and teachers' perceptions of school climate
    and problems in their schools, teacher compensation, district hiring and retention
    practices, to basic characteristics of the student population. The survey was conducted
    using mail, email, paper questionnaires, and telephone interviews. Teachers, librarians,
    principals, and school coordinators were sampled. Key statistics produced from SASS
    03-04 are how many teachers and principals remained at the same school, moved to
    another school, or left the profession in the year following the SASS administration.",nt"license_title":
